import numpy as np
### Fonction que j'utilise pour selectionner les bandes de Hytexila les plus proches de IMEC25
###
def find_closest_bands(all_bands,specific_bands):
    """
    @param all_bands: The whole spectral working domain
    @param specific_bands: bands associated to the MSFA pattern
    @return:  The closest centers and their indexes
    """
    selected_bands = []
    selected_idx = []
    current_all_bands = np.copy(all_bands)
    for b1 in specific_bands:
        if len(selected_bands)>1:
           current_all_bands = [all_bands[i] for i in range(len(all_bands)) if i not in selected_bands]
        closest_idx = np.abs(current_all_bands-b1).argmin()
        band = current_all_bands[closest_idx]
        selected_bands.append(band)
        selected_idx.append(np.where(band==all_bands)[0][0])
    return selected_bands,selected_idx

